// check if email options are all blank, expects jquery object
function isPanelEmpty(element) {
  var isEmpty = true;
  var panel = element.closest('.panel');
  panel.find('input:text, textarea').each(function checkTextInputs() {
    if ($(this).val() !== '') {
      isEmpty = false;
      return false;
    }
  });
  panel.find('input:checkbox').each(function checkCheckbox() {
    if ($(this).is(':checked')) {
      isEmpty = false;
      return false;
    }
  });

  return isEmpty;
}

// vaildate one or more email addresses if email is turned on
function validateEmailTo() {
  var emailRegex = /\b\w+@[\w.]+\.[A-z.]{2,4}\b/i;
  var emailErrors = 0;


  $('.email-to').val($('.email-to').val().replace(/\s+/g, '').replace(';', ','));
  $.each($('.email-to').val().split(','), function countErrors(index, value) {
    if (!emailRegex.test(value)) {
      emailErrors++;
    }
  });

  if (emailErrors === 0) {
    // cleared the check
    turnEmailErrorOff();
  } else if (isPanelEmpty($('.email-to'))) {
    // so... it didn't clear the check, but email is off so just remove bad email address and call it good
    turnEmailErrorOff();
  } else {
    // failed the check
    turnEmailErrorOn();
  }
}

// json url verification and behavior

function turnJsonErrorOn() {
  $('#asq_post_json_url').parent().addClass('has-error');
  $('#json_url_error').slideDown();
  $('button.save').attr('disabled', true);
}

function turnJsonErrorOff() {
  $('#asq_post_json_url').parent().removeClass('has-error');
  $('#json_url_error').slideUp();
  $('button.save').removeAttr('disabled');
}

function toggleJsonOptions() {
  if ($('#asq_post_json_on_alarm').is(':checked')) {
    $('#asq_post_json_url').removeAttr('readonly');
  } else {
    $('#asq_post_json_url').attr('readonly', true);
  }
}

function validateJsonUrlTo() {
  var urlRegex = /[-a-zA-Z0-9@:%._\+~#=]{2,256}\.[a-z]{2,6}\b([-a-zA-Z0-9@:%_\+.~#?&//=]*)/;
  var urlErrors = 0;

  if (!urlRegex.test($('#asq_post_json_url').val())) {
    urlErrors++;
  }

  if (urlErrors === 0) {
    // cleared the check
    turnJsonErrorOff();
  } else if (!$('#asq_post_json_on_alarm').is(':checked')) {
    // so... it didn't clear the check, but email is off so just remove bad email address and call it good
    $('#asq_post_json_url').val('');
    turnJsonErrorOff();
  } else {
    // failed the check
    turnJsonErrorOn();
  }
}

